When calling a function, you can specify optional named parameters using paramName: value. For example:
enableFlags(bold: true, hidden: false);

When defining a function, use {param1, param2, …} to specify named parameters:
void enableFlags({bool bold, bool hidden}) {...}

Wrapping a set of function parameters in [] marks them as optional positional parameters:
String say(String from, String msg, [String device]) {
  var result = '$from says $msg';
  if (device != null) {
    result = '$result with a $device';
  }
  return result;
}

Here’s an example of calling this function without the optional parameter:
assert(say('Bob', 'Howdy') == 'Bob says Howdy');

if the parameter is required, add @required annotation in front of the parameter, otherwise everything will be optional
