Navigation
Navigator Navigation in Flutter, pages are managed as stack, last in first out. The last pushed in page is visible.
Navigator.push(context, MaterialPageRoute(builder:(BuildContext)=> NewPage()))

Navigator.push().then(value) will listen to value once the Navigator.pop(context,value) passed a value.

When former page use push, the latter page will have back button on its Appbar. Use Widget WillPopScope to use back button in the appBar.
When former page use pushReplacement, the former page is destroyed from the stack.

Navigation between Stacks:Switch between different stacks can cause info loss on the page.
